{'LL_response_content': 'Dear yogacraze123,

Thank you for taking the time to review the Speed Up Tight *Full-On Luxtreme Brushed 28". We're sorry to read of your recent experience and would love to discuss this further.

Please give us a call at our Guest Education Centre (1.877.263.9300) or jump on Live Chat to speak directly with an educator. We look forward to speaking with you soon!', 'LL_response_date': 'February 8, 2019'}

